import React from 'react'
import axios from'axios';
import './App.css'


class Article extends React.Component {
  state = {
    articles : []
  }
  componentDidMount() {
    axios.get('http://127.0.0.1:8000/blog/api/list/').then(res => {
      this.setState({
        articles: res.data
      });
      console.log(res.data);
    })
  }
}



function App() {
  return (
    <div className='App'>
      <header className='App-header'>
        <p>Hamid</p>
      </header>
    </div>
  )
}

export default App
